ISLAMABAD, Feb 9 (APP): Independent candidate, Omer Ayub Khan has won the election for National Assembly constituency NA-18, Haripur by securing 192,948 votes.
According to the unofficial result issued by the Returning Officer/ECP, his runner-up was Pakistan Muslim League (N) candidate, Babar Nawaz Khan who bagged 112,389 votes. The votersâ€™ turn-out remained 49.88%.
